import React  from 'react';
import Moment from 'react-moment';
import moment from 'moment';
import ReactDOM from 'react-dom';
import Countdown from 'react-countdown';

export default class ProposalEndDate extends React.Component {

 
  render() {
    const { refCallback, time } = this.props;
   
      return (
        <Countdown
        // When the component mounts, this will 
        // call `refCallback` in the parent component,
        // passing a reference to this `Countdown` component
        ref={refCallback} 
        date={Date.now() + (time * 60)}
        intervalDelay={3}
        zeroPadTime={2}
        autoStart={true}
        daysInHours
    />


      );
  }
}
